  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kodiak NWR outlines
  Refuge accomplishments from January through April of 1951. The report begins by
  summarizing the weather conditions during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, and
  mammals- is also covered. The Refuge development and maintenance section discusses
  physical developments. The public relations section of the report describes Refuge
  visitors, Refuge participation, hunting, fishing, and violations. Items of interest
  and photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
